            bool result = true;

            result &= PrintZpl(hubLabelPrinterAddress, string.Format(JiliaHubZpl, "", MacAddress, BoardId));
            result &= PrintZpl(activationCodePrinterAddress, string.Format(macZpl, MacAddress));
            result &= PrintZpl(activationCodePrinterAddress, string.Format(activationCodeZpl, ActivationCode));

            return result;
        }

        public bool TearDown()
        {
            // No TearDown necessary
            return true;
        }

        private bool PrintZpl(string printerAddress, string zpl)
        {
            try
            {
                TcpClient client = new TcpClient();
                client.Connect(printerAddress, 9100);

                System.IO.StreamWriter writer = new System.IO.StreamWriter(client.GetStream());
                writer.Write(zpl);
                writer.Flush();

                writer.Close();
                client.Close();
                return true;
            }
            catch
            {
                return false;
            }
        }

        public void Cancel()
        {
            throw new NotImplementedException();
        }
    }
}
